import React from 'react'

const ApresentaCarro = ( carro ) => {

  return (
    <div>
            <p>Marca: {carro.marca}</p>
            <p>Ano: {carro.cor}</p>
            <p>Cor: {carro.zero}</p>
            <p>Descrição: {carro.km}</p>
    </div>
  )
}

export default ApresentaCarro
